css:
.auto-cursor {
  cursor: default;
}
autocomplete-suggestion-list .suggestion-list-scroller ol.list-group li.kite-completion {
  font-size: 1.0em;
}
autocomplete-suggestion-list .suggestion-list-scroller ol.list-group li.kite-completion .icon-container i.icon {
  position: relative;
}
autocomplete-suggestion-list .suggestion-list-scroller ol.list-group li.kite-completion .icon-container i.icon::after {
  content: '';
  display: block;
  width: 0.85em;
  height: 0.85em;
  mask-image: url('atom://kite/assets/logo-completions.svg');
  -webkit-mask-image: url('atom://kite/assets/logo-completions.svg');
  mask-size: contain;
  -webkit-mask-size: contain;
  mask-repeat: no-repeat;
  -webkit-mask-repeat: no-repeat;
  background-color: #9da5b4;
  position: absolute;
  bottom: 5px;
  right: 0px;
}
autocomplete-suggestion-list .suggestion-list-scroller ol.list-group li.kite-completion .right-label {
  float: right;
  position: relative;
}
autocomplete-suggestion-list .suggestion-list-scroller ol.list-group li.kite-completion .right-label .kind {
  padding-right: 0.25em;
}
autocomplete-suggestion-list .suggestion-list-scroller ol.list-group li.kite-completion .right-label .kind .separator {
  padding: 0 0.2em;
}
autocomplete-suggestion-list.select-list.popover-list .suggestion-description.kite-completions {
  padding: 5px;
  padding-left: 5px;
  overflow: visible;
  background: #21252b;
}
atom-text-editor[data-grammar="source python"] .autocomplete-suggestion-list.select-list.popover-list .kite-completions .suggestion-description-content {
  white-space: normal !important;
  padding-right: 5px;
}
atom-text-editor[data-grammar="source python"] .autocomplete-suggestion-list.select-list.popover-list .kite-completions .suggestion-description-content .kite-completion-description {
  font-size: 1em;
  max-width: 600px;
  line-height: var(--editor-line-height);
  overflow: hidden;
  display: -webkit-box;
  -webkit-line-clamp: 3;
  -webkit-box-orient: vertical;
}
